import React, { useEffect, useState } from 'react';
import Navbar from '../AdminNavbar/AdminNavbar';
import { fetchAllUsers } from '../../../api/Api.js';
// import { DataGrid } from '@mui/x-data-grid';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardActionArea from '@mui/material/CardActionArea';
import { useHistory } from 'react-router-dom';





const AdminDashboard = () => {
    const history = useHistory();
    const [data, setData] = useState([]);


    const fetchallusers = async () => {
        const responce = await fetchAllUsers();
        // console.log(responce);
        console.log(responce.data);
        const allUsers = responce.data;
        setData({ allUsers });
        // console.log(data);
    }

    useEffect(() => {
        fetchallusers();
    }, []);

    console.log("data ", data);



    return (
        <>
            <Navbar />
            <Grid container style={{ padding: '30px', width: "100%", marginBottom: 'none', backgroundColor: "#7900FF" }} >
                <h2>Admin Dashboard</h2>
            </Grid>




            <Grid container justify="space-between" spacing={2} style={{ padding: '30px', width: "100%", marginBottom: 'none', backgroundColor: "#7900FF" }} >
                <Grid item xs={12} md={4}  >
                    <Card style={{ backgroundColor: '#757ce8' }} >
                    <CardActionArea onClick={() => { history.push("/admin/users"); }} >
                            <CardContent>
                                <Typography gutterBottom variant="h5" component="div">
                                    Users
                                </Typography>
                                <Typography variant="body2" color="text.secondary">
                                    List of all users
                                </Typography>
                            </CardContent>
                        </CardActionArea>
                    </Card>
                </Grid>
                <Grid item xs={12} md={4}  >
                    <Card style={{ backgroundColor: '#757ce8' }} >
                        <CardActionArea onClick={() => { history.push("/admin/cars"); }} >
                            <CardContent>
                                <Typography gutterBottom variant="h5" component="div">
                                    Cars
                                </Typography>
                                <Typography variant="body2" color="text.secondary">
                                    List of all cars
                                </Typography>
                            </CardContent>
                        </CardActionArea>
                    </Card>
                </Grid>
                <Grid item xs={12} md={4}  >
                    <Card style={{ backgroundColor: '#757ce8' }} >
                        <CardActionArea  >
                            <CardContent>
                                <Typography gutterBottom variant="h5" component="div">
                                    Car Reports
                                </Typography>
                                <Typography variant="body2" color="text.secondary">
                                   List of all Car Reports
                                </Typography>
                            </CardContent>
                        </CardActionArea>
                    </Card>
                </Grid>
            </Grid>



        </>
    )
}

export default AdminDashboard;
